import "./App.css";
import Cards from "./components/Cards";
import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import ViewNaruto from "./views/ViewNaruto";
import ViewDragonBall from "./views/ViewDragonBall";
import PageNotFound from "./views/PageNotFound";
import PageAnime from "./views/PageAnime";

function App() {
  return (
    <Router>
      <nav className="navbar navbar-expand bg-dark">
        <ul className="nav navbar-nav">
          <li className="nav-item">
            <Link to="/" className="nav-link text-light">
              Inicio
            </Link>
          </li>
          <li className="nav-item ">
            <Link to="/naruto" className="nav-link text-light">
              Naruto Shippuden
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/dragonball" className="nav-link text-light">
              {" "}
              Dragon Ball Super{" "}
            </Link>
          </li>
        </ul>
      </nav>
      <Switch>
        <Route exact path="/" component={PageAnime} />
        <Route exact path="/naruto" component={ViewNaruto} />
        <Route exact path="/dragonball" component={ViewDragonBall} />
        <Route component={PageNotFound} />
      </Switch>
    </Router>
  );
}

export default App;
